using REAC_AndroidAPI.Utils.Output;
using System;
using System.Collections.Generic;
using System.IO;
using System.Text;

namespace REAC_AndroidAPI.Utils.Storage
{
    class ProfilePhoto
    {
        private const string DEFAULT_PROFILE_PHOTO = "";

        public static byte[] GetProfilePhoto(uint userId, string extension, out string format)
        {
            byte[] array = null;
            try
            {
                if (!Directory.Exists(AppDomain.CurrentDomain.BaseDirectory + Path.DirectorySeparatorChar + ".." + Path.DirectorySeparatorChar + "photo"))
                    Directory.CreateDirectory(AppDomain.CurrentDomain.BaseDirectory + Path.DirectorySeparatorChar + ".." + Path.DirectorySeparatorChar + "photo");
                
                array = File.ReadAllBytes(AppDomain.CurrentDomain.BaseDirectory + Path.DirectorySeparatorChar + ".." + Path.DirectorySeparatorChar + "photo" + Path.DirectorySeparatorChar + userId.ToString() + "." + extension);
            }
            catch (Exception e)
            {
                Logger.WriteLine(e.ToString(), Logger.LOG_LEVEL.ERROR);
            }
            
            if(extension == "png")
                format = "image/png";
            else
                format = "image/jpeg";

            if (array == null)
            {
                array = Convert.FromBase64String(DEFAULT_PROFILE_PHOTO);
                format = "image/jpeg";
            }

            return array;
        }

        public static void AddProfilePhoto(byte[] image, uint userId, string extension)
        {
            string filePath = AppDomain.CurrentDomain.BaseDirectory + Path.DirectorySeparatorChar + ".." + Path.DirectorySeparatorChar + "photo" + Path.DirectorySeparatorChar + userId.ToString() + "." + extension;
            try
            {
                FileInfo file = new FileInfo(filePath);
                file.Directory.Create(); // If the directory already exists, this method does nothing.

                File.WriteAllBytes(filePath, image);
            }
            catch (Exception e)
            {
                Logger.WriteLine(e.ToString(), Logger.LOG_LEVEL.ERROR);
            }
        }
    }
}
